import React, {Component} from "react"
import {BrowserRouter, Switch, Route} from "react-router-dom"

import "../css/App.css"


export default class HeadParagraph extends Component
{

    render()
    {

        return (
            <div className="HeadParagraph">
                <div className="bold_para">For Him</div>
                <div className="text_para">Explore our vast and effervescent collection of Parfum Pour Homme</div>
            </div>
        )
    }
}
